import React  from 'react';
import { StyleSheet, Text, View} from 'react-native';

import Home from './Screens/Home';
import Create from './Screens/Create';
import VaccineDetails from './Screens/VaccineDetails';
import VaccineEdit from './Screens/VaccineEdit';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';


const Stack = createStackNavigator();

const myStyles ={
  title: 'Vaccines List',
  headerTintColor: 'white',
  headerStyle:{
  backgroundColor:'green'
  }
}

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={Home} 
        options={myStyles}
        />
        <Stack.Screen name="Create" component={Create} 

        options={{...myStyles, title:'Add Vaccines'}}

        />


         <Stack.Screen name='Details' component={VaccineDetails} 

        options={{...myStyles, title:'Details'}}



        />


      <Stack.Screen name='Edit' component={VaccineEdit} 

        options={{...myStyles, title:'Edit'}}



        />



      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
